contracts/NFTTreasury.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract NFTTreasury {
    string public name;
    string public symbol;
    uint256 private _tokenIdCounter;
    
    mapping(uint256 => address) public ownerOf;
    mapping(address => uint256) public balanceOf;
    mapping(uint256 => address) public getApproved;
    mapping(address => mapping(address => bool)) public isApprovedForAll;
    mapping(uint256 => string) public tokenURI;
    
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);
    
    constructor(string memory _name, string memory _symbol) {
        name = _name;
        symbol = _symbol;
    }
    
    function mint(address to, string memory uri) external returns (uint256) {
        uint256 tokenId = _tokenIdCounter++;
        ownerOf[tokenId] = to;
        balanceOf[to]++;
        tokenURI[tokenId] = uri;
        
        emit Transfer(address(0), to, tokenId);
        return tokenId;
    }
    
    function approve(address to, uint256 tokenId) external {
        address owner = ownerOf[tokenId];
        require(msg.sender == owner || isApprovedForAll[owner][msg.sender], "Not authorized");
        getApproved[tokenId] = to;
        emit Approval(owner, to, tokenId);
    }
    
    function transferFrom(address from, address to, uint256 tokenId) external {
        require(ownerOf[tokenId] == from, "Not owner");
        require(
            msg.sender == from || 
            msg.sender == getApproved[tokenId] || 
            isApprovedForAll[from][msg.sender],
            "Not authorized"
        );
        
        ownerOf[tokenId] = to;
        balanceOf[from]--;
        balanceOf[to]++;
        delete getApproved[tokenId];
        
        emit Transfer(from, to, tokenId);
    }
    
    function setApprovalForAll(address operator, bool approved) external {
        isApprovedForAll[msg.sender][operator] = approved;
        emit ApprovalForAll(msg.sender, operator, approved);
    }
    
    function totalSupply() external view returns (uint256) {
        return _tokenIdCounter;
    }
}

contracts/SimpleNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract SimpleNFT {
    string public name;
    string public symbol;
    address public owner;
    uint256 public maxSupply;
    bool public publicMintEnabled;
    
    mapping(uint256 => address) public ownerOf;
    mapping(uint256 => string) public tokenURI;
    mapping(address => uint256) public balanceOf;
    
    uint256 public totalSupply;
    
    event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    
    constructor(
        string memory _name, 
        string memory _symbol, 
        address _owner,
        uint256 _maxSupply,
        bool _publicMintEnabled
    ) {
        name = _name;
        symbol = _symbol;
        owner = _owner;
        maxSupply = _maxSupply;
        publicMintEnabled = _publicMintEnabled;
    }
    
    function mint(address to, uint256 tokenId, string memory uri) external {
        require(msg.sender == owner, "Only owner can mint");
        require(totalSupply < maxSupply, "Max supply reached");
        require(ownerOf[tokenId] == address(0), "Token already exists");
        
        ownerOf[tokenId] = to;
        tokenURI[tokenId] = uri;
        balanceOf[to]++;
        totalSupply++;
        
        emit Transfer(address(0), to, tokenId);
    }
}

contracts/SimpleStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract SimpleStorage {
    uint256 private storedValue;
    
    event ValueUpdated(uint256 newValue);
    
    function setValue(uint256 _value) public {
        storedValue = _value;
        emit ValueUpdated(_value);
    }
    
    function getValue() public view returns (uint256) {
        return storedValue;
    }
    
    function increment() public {
        storedValue += 1;
        emit ValueUpdated(storedValue);
    }
}

